import React from 'react'
import { Header, Image, Icon } from 'semantic-ui-react'


const HeaderMenu = () => (
  <div>
    <Header as='h1'>
      <Header.Content>

      </Header.Content>
    </Header>
    <style jsx global>
      {`
        .ui.right.floated.image, .ui.right.floated.images {
          width: 16em;
        }
      `}
    </style>
  </div>
)

export default HeaderMenu
